     const dispatch =useDispatch()
     const value=useSelector(state=>state)
    return (
        <div>
            <h1>{value}</h1>
            <button onClick={()=>dispatch(Plus())}>Plus</button>
            <button onClick={()=>dispatch(Moins())}>Moins</button>

        </div>
    )
}
export default Test;
